import React from 'react';
import './App.css';
import firebase from '../firebase'
import { Button, Grid, Header, Segment, Comment, Label,Image, Icon } from 'semantic-ui-react';
import HeaderPanel from './Header/header'
import SidePanelLeft from './SidePanel/SidePanelLeft'
import SidePanelRight from './SidePanel/SidePanelRight'

class App extends React.Component{

  logout = event =>{
    firebase.auth().signOut();
  }

  render(){
    return(
      <Grid>

            <HeaderPanel />
            <SidePanelLeft />
            <SidePanelRight />

          <Grid.Column style={{width: '100%' ,marginTop: '90px', marginLeft: '300px', marginRight: '300px'}}>
            <Segment>

                <Comment.Group> 
                  <Comment>
                    <Comment.Avatar as='a' src='https://www.gravatar.com/avatar/b4339e6c847f4f25822532330320548e?d=identicon' />
                    <Comment.Content>
                      <Comment.Author>LamSonhai</Comment.Author>
                      <Comment.Metadata>
                        1:00pm
                      </Comment.Metadata>
                      <Comment.Text>
                        sssdass
                      </Comment.Text>
                     <Label attached  as='a'>
                      <Icon name='thumbs up outline' />
                     </Label>
                    </Comment.Content>

                  </Comment>
                </Comment.Group>

            </Segment>
          </Grid.Column>


      </Grid>

    )
  }
}

export default App;
